import React from 'react';
import ReactDOM from 'react-dom';
import { add , sub } from './Cal';
ReactDOM.render(
    <>
       <h1>Add of two element{ add(3,4) }</h1>
       <h1>Sum of two element{ sub(4,3) }</h1>
    </>,
    document.getElementById('root')
);
